import React, { Component } from 'react';
import './css/main.css';
import Header from './components/HeaderComponent';
import Table from './components/TableComponent';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <hr />
        <Table />

      </div>
    );
  }
}

export default App;
